import React, { useState, useEffect } from 'react';
import styles from './ArtifactsList.css';

function ArtifactsList() {
  const [artifacts, setArtifacts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5015/api/artifacts')
      .then(response => {
        if (!response.ok) {
            console.log("reached");
          throw new Error(`Server responded with status: ${response.status} - ${response.statusText}`);
        }
        return response.json();
      })
      .then(data => {
        setArtifacts(data);
        setLoading(false);
      })
      .catch(error => {
        setError(error.message);
        setLoading(false);
      });
  }, []);



  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  // return (
  //   <div className="artifacts-list">
  //     <h1>Artifacts</h1>
  //     <div className="artifacts-container">
  //       {artifacts.map(artifact => (
  //         <div key={artifact.id} className="artifact-card">
  //           <img src={artifact.image} alt={artifact.name} className="artifact-image" />
  //           <h2>{artifact.name}</h2>
  //           <p>Artist: {artifact.artist}</p>
  //           <p>Description: {artifact.description}</p>
  //         </div>
  //       ))}
  //     </div>
  //   </div>
  // );
  return (
    <div className={styles['artifacts-list']}>
      <h1>Artifacts</h1>
      <div className={styles['artifacts-container']}>
        {artifacts.map(artifact => (
          <div key={artifact.id} className={styles['artifact-card']}>
            <img src={artifact.image} alt={artifact.name} className={styles['artifact-image']} />
            <div className={styles['artifact-info']}>
              <h2>{artifact.name}</h2>
              <p>Artist: {artifact.artist}</p>
              <p>Description: {artifact.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
export default ArtifactsList;
